import React from "react";

interface MainContainerProps {
  selected: string;
}

const MainContainer: React.FC<MainContainerProps> = ({ selected }) => {
  return (
    <div>
      <h2>Selected Option: {selected}</h2>
    </div>
  );
};

export default MainContainer;
